import React from 'react'


const List = ({items}) =>{
    return (
        <ul className="todo__list">
            {
               items.map(i => ( <li className="active">
                <i>{i.icon ? i.icon : <i style="background-color:{items.color}" className='circle'></i>}</i> 
                <span>{i.name}</span>
                </li>))
            }
        </ul> 
    );
};

export default List;
